(24, 1, '2022-02-20 15:25:55', '2022-02-20 15:25:55', '<label> [text* your-name maxlength:64 placeholder \"Your name\"] </label>\r\n\r\n<label> [email* your-email placeholder \"Your email\"] </label>\r\n\r\n<label> [text* your-subject maxlength:256 placeholder \"Your subject\"] </label>\r\n\r\n<label> [textarea your-message maxlength:500 placeholder \"Your message\"] </label>\r\n\r\n[acceptance acceptance-653]\r\n Yes, I consent to my data being stored according to the guidelines set out in the <a href=\"/privacy-policy\">Privacy Policy</a>\r\n[/acceptance]\r\n\r\n[submit \"Submit\"]\n1\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@local.softcdkey.ru>\n[_site_admin_email]\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [your-email]\n\n\n\n\n[_site_title] \"[your-subject]\"\n[_site_title] <wordpress@local.softcdkey.ru>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on [_site_title] ([_site_url])\nReply-To: [_site_admin_email]\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nФормат даты некорректен.\nВведённая дата слишком далеко в прошлом.\nВведённая дата слишком далеко в будущем.\nФормат числа некорректен.\nЧисло меньше минимально допустимого.\nЧисло больше максимально допустимого.\nНеверный ответ на проверочный вопрос.\nНеверно введён электронный адрес.\nВведён некорректный URL адрес.\nВведён некорректный телефонный номер.', 'Contact Us', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2022-05-14 15:16:51', '2022-05-14 15:16:51', '', 0, 'http://local.softcdkey.ru/?post_type=wpcf7_contact_form&#038;p=24', 0, 'wpcf7_contact_form', '', 0),
